import React, { useState } from 'react';
import './App.css';

// Import your hashing classes here (if they are exported from a module)
import { extendible_hasher, linear_hasher } from './hashingClasses';

function App() {
  const [key, setKey] = useState('');
  const [value, setValue] = useState('');
  const [result, setResult] = useState('');

  const handleInsert = () => {
    extendible_hasher.insert(parseInt(key), value);
    setResult(JSON.stringify(extendible_hasher.display()));
  };

  const handleSearch = () => {
    const foundValue = extendible_hasher.search(parseInt(key));
    setResult(foundValue !== null ? `Found: ${foundValue}` : 'Key not found');
  };

  const handleDelete = () => {
    extendible_hasher.delete(parseInt(key));
    setResult(JSON.stringify(extendible_hasher.display()));
  };

  return (
    <div className="App">
      <h1>Extendible Hashing and Linear Hashing</h1>
      <h2>Hashing Example</h2>

      <h3>Extendible Hashing</h3>
      <input
        type="number"
        placeholder="Key"
        value={key}
        onChange={(e) => setKey(e.target.value)}
      />
      <input
        type="text"
        placeholder="Value"
        value={value}
        onChange={(e) => setValue(e.target.value)}
      />
      <button onClick={handleInsert}>Insert</button>
      <button onClick={handleSearch}>Search</button>
      <button onClick={handleDelete}>Delete</button>

      <h3>Result</h3>
      <p>{result}</p>
    </div>
  );
}

export default App;
